import React from "react";
import { NavLink, Router } from 'react-router-dom'; 

const Nav = (e) => {
  return (
    <div>
      <NavLink to="/" >Home</NavLink>
      <NavLink to="/section/US" onDoubleClick={window.location.reload}>US</NavLink>
      <NavLink to="/section/World" refresh={true}>World</NavLink>
      <NavLink to="/section/Politics" refresh={true}>Politics</NavLink>
      <NavLink to="/section/Business" refresh={true}>Business</NavLink>
      <NavLink to="/section/Technology" refresh={true}>Technology</NavLink>
      <NavLink to="/section/Sports" refresh={true}>Sports</NavLink>
      <NavLink to="/section/Gaming" refresh={true}>Gaming</NavLink>
      <NavLink to="/section/Feedback" refresh={true}>Feeback</NavLink>
    </div>
  );
};

export default Nav;
